DROP TABLE IF EXISTS new;
CREATE TABLE new (
	newId int(255) unsigned not null auto_increment,
	ip varchar(255) not null,
	port varchar(8) not null,
	timestamp int(11) unsigned not null,
	primary key(newId,ip,port)
);

DROP TABLE IF EXISTS good;
CREATE TABLE good (
	goodId int(255) unsigned not null auto_increment,
	ip varchar(255) not null,
	port varchar(8) not null,
	type varchar(255) default null,
	alevel  varchar(255) default null,
	recent int(11) unsigned not null,
	timestamp int(11) unsigned not null,
	primary key(goodId,ip,port)
);

DROP TABLE IF EXISTS inactive;
CREATE TABLE inactive (
	inactiveId int(255) unsigned not null auto_increment,
	ip varchar(255) not null,
	port varchar(8) not null,
	type varchar(255) default null,
	alevel  varchar(255) default null,
	recent int(11) unsigned not null,
	timestamp int(11) unsigned not null,
	primary key(inactiveId,ip,port)
);

DROP TABLE IF EXISTS banned;
CREATE TABLE banned (
	bannedId int(255) unsigned not null auto_increment,
	ip varchar(255) not null,
	timestamp int(11) unsigned not null,
	primary key(bannedId,ip)
);

